'use strict';

require('./saved_gis_map');

var _modules = require('ui/modules');

var _saved_object_loader = require('ui/courier/saved_object/saved_object_loader');

var _saved_object_registry = require('ui/saved_objects/saved_object_registry');

var _saved_objects = require('ui/saved_objects');

var _module = _modules.uiModules.get('app/maps');

// Register this service with the saved object registry so it can be
