_saved_object_registry.SavedObjectRegistryProvider.register({
  service: 'gisMapSavedObjectLoader',
  title: 'gisMaps'
});

// This is the only thing that gets injected into controllers
_module.service('gisMapSavedObjectLoader', function (Private, SavedGisMap, kbnIndex, kbnUrl, $http, chrome) {
  var savedObjectClient = Private(_saved_objects.SavedObjectsClientProvider);
  return new _saved_object_loader.SavedObjectLoader(SavedGisMap, kbnIndex, kbnUrl, $http, chrome, savedObjectClient);
});
